// Firebase init
firebase.initializeApp(config);
var storageRef = firebase.storage().ref();
var file1Ref = storageRef.child('file1.tsv');
var file2Ref = storageRef.child('file2.tsv');

function handleFiles(delegate, files) {
	var file = files[0];
	console.log('Uploading file...', file);
	file1Ref.put(file).then(function(snapshot) {
		console.log('File uploaded.');
		var downloadURL = snapshot.downloadURL;

		collectDataFromFile({
			url: downloadURL,
			set: delegate == 'chart1' ? 1 : 2
		});

	});
}

function collectDataFromFile(options) {
	console.log("COLLECTING DATA...");

  DATA[options.set] = [];

	d3.tsv(options.url, function(error, data) {
	  if (error) throw error;
	  var data_error;

	  data.forEach(function(d) {
	  	// console.log(d);
	    var keys = Object.keys(d);
	    if (keys.length < 3) data_error = 'The data is not formatted correctly. Ensure text file headers are separated by TABS.';

	    d[DATAX] = +d[keys[2]];
	    d[DATAY] = +d[keys[1]];

      console.log( d );
      DATA[options.set].push(d);

	    RANGEX = Math.max(Math.abs(d[DATAX]), Math.abs(RANGEX));
	    RANGEY = Math.max(Math.abs(d[DATAY]), Math.abs(RANGEY));
	  });

	  if (data_error) alert(data_error);

	  console.log('DONE LOADING DATA:', DATA);
	  plot();
    // analyzeData();

	});

}


function analyzeData() {

  $('#loading').show();
  // $('#chart').hide();
  $('#analysis').hide();

  setTimeout(function () {

    if (DATA[2].length > 0 && DATA[1].length > 0) {

      $.ajax({
        type: "POST",
        url: '/analyze',
        data: {
          dataset1: DATA[1],
          dataset2: DATA[2],
          tolerance: TOLERANCE
        },
        success: function(response) {
          console.log(response);

          $('#hits').html( response.hits + "/" + DATA[2].length );
          $('#q1accuracy').html( response.coverage_areas['quadrant1'].accuracy + "%" );
          $('#q2accuracy').html( response.coverage_areas['quadrant2'].accuracy + "%" );
          $('#q3accuracy').html( response.coverage_areas['quadrant3'].accuracy + "%" );
          $('#q4accuracy').html( response.coverage_areas['quadrant4'].accuracy + "%" );
          $('#accuracy').html( response.accuracy + "%" );
          $('#coverage').html( response.coverage + '%' );

          $('#loading').hide();
          // $('#chart').show();
          $('#analysis').show();
        }
      });
    }

  }, 100);
}



// gridlines in x axis function
function make_x_gridlines(x) {   
    return d3.axisBottom(x)
        .ticks(10)
}

// gridlines in y axis function
function make_y_gridlines(y) {   
    return d3.axisLeft(y)
        .ticks(10)
}


function plot() {

  console.log('plot');

	$('#loadin').show();
	$('#chart').html('');

  var dimension = parseInt($('.main').height() * .9);
  // var dimension_x = parseInt($('.main').width());
  // var dimension_y = parseInt($('.main').height());

	var margin = {top: 20, right: 20, bottom: 20, left: 20},
	    width = dimension - margin.left - margin.right,
	    height = dimension - margin.top - margin.bottom;

  console.log(width, height, dimension);

	var x = d3.scaleLinear().range([0, width]);
	var y = d3.scaleLinear().range([height, 0]);

  var svg = d3.select('#chart')
	  .append("svg")
	    .attr("width", width + margin.left + margin.right)
	    .attr("height", height + margin.top + margin.bottom)
	  .append("g")
	    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

	// Scale the range of the data
  x.domain([-RANGEX, RANGEX]).range([0, width]).nice();
  y.domain([-RANGEY, RANGEY]).range([0, height]).nice();


  // add the X gridlines
  svg.append("g")     
      .attr("class", "grid")
      .attr("transform", "translate(0," + height + ")")
      .call(make_x_gridlines(x)
          .tickSize(-height)
          .tickFormat("")
      )

  // add the Y gridlines
  svg.append("g")     
      .attr("class", "grid")
      .call(make_y_gridlines(y)
          .tickSize(-width)
          .tickFormat("")
      )

  // Add the X Axis
  svg.append("g")
    .attr("class", "chart-item")
    .attr("transform", "translate(0,"+height/2+")")
    .call(d3.axisBottom(x));

  // text label for the x axis
  svg.append("text")  
    .attr("class", "chart-item")           
    .attr("transform", "translate(" + width/2 + "," + (height + margin.top) + ")")
    .style("text-anchor", "middle")
    .text( DATAX );


  // Add the Y Axis
  svg.append("g")
    .attr("class", "chart-item")       
    .attr("transform", "translate(" + width/2 + ", 0)")
    .call(d3.axisLeft(y));

  // text label for the y axis
  svg.append("text")
    .attr("class", "chart-item")
    .attr("transform", "rotate(-90)")
    .attr("y", 0 - (margin.bottom + (margin.bottom/2)) )
    .attr("x", 0 - (width / 2))
    .attr("dy", "2em")
    .style("text-anchor", "middle")
    .text( DATAY ); 


  var valueline = d3.line()
    .x(function(d) { return x(d[DATAX]); })
    .y(function(d) { return y(d[DATAY]); });

  svg.append("path")
      .data([DATA['1']])
      .attr("class", "control line")
      .attr("d", valueline);


  svg.append("path")
      .data([DATA['2']])
      .attr("class", "actual line")
      .attr("d", valueline);


  $('#loadin').hide();
}

$(window).resize(function(evt) {
  plot();
});
